import { useState,useNavigate,useEffect } from 'react';
import Booking from '../components/booking/Booking';
import Thanks from '../pages/Thanks';
import BookPanel from '../pages/BookPanel';
import BottomBar from '../components/navbar/BottomBar';
import NotAvilable from '../pages/NotAvilable';
import NotFound from '../pages/NotFound';
import { Link } from 'react-router-dom';
const Home = (props) => {
  let status=JSON.stringify(props.isAuthenticated);
  const [isAuthenticated,setAuthentication] = useState(status);

  useEffect(() => {
      const storedValue = localStorage.getItem('isAuthenticated');
      if (storedValue === false) {
          setAuthentication(storedValue);
      }
  }, []);

  return (
    <>
    <div className='booking_area w-full' id="back">
        <div className="max-w-6xl w-full px-4 lg:px-0 mx-auto">

          {
            isAuthenticated===true ? (
              <Booking />
            ):
            (
              <NotFound/>
            )
          }            


        </div>
        <BottomBar/>
    </div>
    </>
  )
}

export default Home
